CREATE DATABASE ORDERS ;
CREATE TABLE `mytable` (
  `Category` VARCHAR(100),
  `City` VARCHAR(100),
  `Order Date` VARCHAR(100),
  `Order Month` VARCHAR(100),
  `Order Day` VARCHAR(100),
  `Order Number` DOUBLE,
  `Order Week` VARCHAR(100),
  `Order Year` DOUBLE,
  `Postal Code` VARCHAR(100),
  `Product ID` VARCHAR(100),
  `Region` VARCHAR(100),
  `Segment` VARCHAR(100),
  `Ship Date` VARCHAR(100),
  `Ship Day` VARCHAR(100),
  `Ship Mode` VARCHAR(100),
  `Ship Week` VARCHAR(100),
  `Shipping Period (Day)` DOUBLE,
  `Shipping Rate` VARCHAR(100),
  `State/Province` VARCHAR(100),
  `Sub-Category` VARCHAR(100),
  `Discount Value` DOUBLE,
  `Product Price` DOUBLE,
  `Profit` DOUBLE,
  `Quantity` DOUBLE,
  `Sales` DOUBLE,
  `Target` VARCHAR(100)
);

